import random

def expMod(x, e, n):
    # Initialization
    y = x
    e = bin(e)
    # print("Using input", y)

    for i in range(3, len(e)):
        y = y * y % n

        if e[i] == "1":
            y = y * x % n

    # print("Function answer:", y)
    return y

